{c_label}Wiederverwerten{/c}
Ermöglicht es Euch, Gegenstände in Handwerksmaterialien zu zerlegen.
Klickt mit der linken Maustaste ({icon:lmb}) erst auf den Amboss und dann auf den Gegenstand, den Ihr wiederverwerten möchtet.
{c_warning}Achtung: Dadurch werden die Gegenstände unwiederbringlich zerstört!{/c}

{c_gold}Stadtportal{/c_gold}
Teleportiert Euch in die Stadt.
Mit ({HOTKEY}) benutzen.

Alptraumsiegel werden verwendet, um einen Dungeon in einen Alptraumdungeon zu verwandeln.

Dies würde ein Alptraumsiegel für "{s1}" herstellen.

Gebrechen: {s2}

Erforderliche Weltstufe: {s3}
